  XW += x[18] * 3.0030000000000001e+01;      // N2H2
  XW += x[19] * 3.0030000000000001e+01;      // H2NN
  XW += x[20] * 3.3030000000000001e+01;      // NH2OH
  XW += x[21] * 3.2021999999999998e+01;      // HNOH
  XW += x[22] * 1.7030999999999999e+01;      // NH3
  XW += x[23] * 3.2045999999999999e+01;      // N2H4
  XW += x[24] * 1.4007000000000000e+01;      // N
