  W += c[7] * 1.8015000000000001e+01;  // H2O
  W += c[8] * 1.7007000000000001e+01;  // OH
  W += c[9] * 3.4014000000000003e+01;  // H2O2
  W += c[10] * 3.3006000000000000e+01; // HO2
  W += c[11] * 3.0006000000000000e+01; // NO
  W += c[12] * 4.4012999999999998e+01; // N2O
  W += c[13] * 4.6005000000000003e+01; // NO2
  W += c[14] * 3.1014000000000003e+01; // HNO
  W += c[15] * 4.7013000000000005e+01; // HNO2
  W += c[16] * 4.7013000000000005e+01; // HONO
  W += c[17] * 6.3012000000000000e+01; // HONO2
  W += c[18] * 3.0030000000000001e+01; // N2H2
  W += c[19] * 3.0030000000000001e+01; // H2NN
  W += c[20] * 3.3030000000000001e+01; // NH2OH
  W += c[21] * 3.2021999999999998e+01; // HNOH
  W += c[22] * 1.7030999999999999e+01; // NH3
  W += c[23] * 3.2045999999999999e+01; // N2H4
  W += c[24] * 1.4007000000000000e+01; // N
  W += c[25] * 6.2003999999999998e+01; // NO3
  W += c[26] * 1.5015000000000001e+01; // NH
  W += c[27] * 2.9021999999999998e+01; // NNH
  W += c[28] * 1.6023000000000000e+01; // NH2
  W += c[29] * 3.2021999999999998e+01; // H2NO
  W += c[30] * 3.1038000000000000e+01; // N2H3

  for (int id = 0; id < 31; ++id) {
    sumC += c[id];
  }
  rho = P * W / (sumC * T * 8.31446261815324e+07); // rho = PW/(R*T)
